import './Nav.css';

import { Link } from 'react-router-dom';






function Nav() {
    return(

        <>
        <div  className='nav-item my-3 w-28 '>
            <nav className="flex justify-center space-x-4">
                <a href="/" className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2"><Link Link to="/" >Home</Link></a>
                <li ><Link to="/team" className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Team</Link></li>
                <li ><Link to="/projects" className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Projects</Link></li>
                <li ><Link to="/reports" className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Reports</Link></li>
            </nav>

            
        </div>


        
        </>
    );
}

export default Nav;
